import React, { Component } from "react";

class Songs extends Component {
  render() {
    return (
      <div>
        {this.props.songs.map(song => {
          return (
            <div key={song.url}>
              <img src={song.image[0]["#text"]} />
              <p>
                {song.name} - {song.artist.name} - {song.image["#text"]}
              </p>
            </div>
          );
        })}
      </div>
    );
  }
}

export default Songs;
